import React, { useEffect } from 'react';
import axios from 'axios';

import { token1 } from '../token';

const city = 'Paphos';

const url = `https://api.openweathermap.org/data/2.5/weather?q=${city}&appid=${token1}`

export default function OpenWeatherScraper() {
    const [weather, setWeather] = React.useState([]);

    useEffect(() => {
        axios.get(url)
            .then(response => {
                setWeather(response.data);
                console.log(response.data);
            })
            .catch(error => { console.log(error) })
    }, []);

    return (
        <React.Fragment>
            <h1>City: {weather.name}</h1>
            <p>Temp: {weather.main ? <p>{weather.main.temp}Â°F</p> : null}</p>
            Clouds: {weather.weather ? <p>{weather.weather[0].main}</p> : null}
            Feels like: {weather.main ? <p>{weather.main.feels_like}</p> : null}

        </React.Fragment>
    )
}
